<script>
  resources = {};
  $('.dot').each(function(el) {
    var re=/lat ([\d\D]*), lon ([\d\D]*)/g;
    extracted = re.exec(this.title);
    if (resources[this.className.split(' ')[1]] == undefined) {
      resources[this.className.split(' ')[1]] = [{lat: extracted[1], lng: extracted[2]}]
    } else {
      resources[this.className.split(' ')[1]].push({lat: extracted[1], lng: extracted[2]})
    }
  });
  Object.keys(resources).forEach(function(resource) {
    $('body').append('<h3>' + resource.replace('-', ' ') + '</h3>')
    resources[resource].forEach(function(resource) {
      $('body').append(resource.lat + ', ' + resource.lng + "<br>")
    });
  })

</script>
